import { Card } from "@material-ui/core";
import assets_data from "../data/assets.json";


const CardData = ()=>{
    // const character = assets_data.assets
    const listCharacter = assets_data.assets.map(character=()=>
        <Card 
            id = {character.id}
            name = {character.name}
            image = {character.image}
            owner = {character.owner}
        />)

    return <div>{listCharacter}</div>

}

export default CardData;
